ting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', '[{\"title\":\"Manufacturer\",\"content\":\"Sunrise\"},{\"title\":\"Boat skipper\",\"content\":\"Bareboat\"},{\"title\":\"Model\",\"content\":\"Summer Breeze\"},{\"title\":\"Year\",\"content\":\"2010\"},{\"title\":\"Number of crew\",\"content\":\"5\"},{\"title\":\"Engines\",\"content\":\"Diesel\"},{\"title\":\"Fuel\",\"content\":\"Composite\"}]', 'Full refund up to 4 days prior.', '<p>For Sanitary purposes ONLY, although there is a working toilet and shower, we\'ve deactivated the shower and the toliet is for limited use (urine only..pardon the graphic detail!). This keeps the boat clean and odor-free for all of our guests.&nbsp; Sinks can be used.</p>\r\n<p>Booking is weather pending. Because of the safety factors associated with the boat and inclement weather, If forecast shows rain, strong winds etc, the Host will communicate with Guest 24-48hrs in advance to mutually cancel/reschedule reservation. No smoking in boat cabin.</p>', 'Arrondissement de Paris', 1, 1, NULL, '2024-04-08 03:26:45', '2024-04-08 03:33:38', NULL, NULL),
