(11, 'The May Fair Hotel', 'the-may-fair-hotel', '<p>Được x&acirc;y dựng v&agrave;o năm 1986, Hotel Stanford l&agrave; điểm du lịch bổ sung cho Thanh H&oacute;a v&agrave; l&agrave; sự lựa chọn th&ocirc;ng minh d&agrave;nh cho kh&aacute;ch du lịch. Sự s&ocirc;i động của trung t&acirc;m th&agrave;nh phố chỉ c&aacute;ch 0 KM. Kh&ocirc;ng k&eacute;m phần đặc biệt l&agrave; kh&aacute;ch sạn c&oacute; thể dễ d&agrave;ng tiếp cận v&ocirc; số điểm tham quan v&agrave; địa danh của th&agrave;nh phố như Toto Music Studio, Ban du lịch Quần đảo Virgin thuộc Anh, L\'Atelier Du Chocolat. Bắt đầu v&agrave; kết th&uacute;c ở San Francisco! Với tour văn h&oacute;a chuy&ecirc;n s&acirc;u Bắc California H&egrave; 2019, bạn c&oacute; g&oacute;i tour 8 ng&agrave;y đưa bạn đi qua San Francisco, Mỹ v&agrave; 9 điểm đến kh&aacute;c tại Mỹ. Bắc California M&ugrave;a h&egrave; 2019 bao gồm chỗ ở cũng như hướng dẫn vi&ecirc;n chuy&ecirc;n nghiệp, c&aacute;c bữa ăn, phương tiện đi lại v&agrave; nhiều thứ kh&aacute;c.</p>\r\n<p>&nbsp;</p>\r\n<p>ĐIỂM NỔI BẬT</p>\r\n<p>Tham quan Bảo t&agrave;ng Nghệ thuật Hiện đại ở Manhattan</p>\r\n<p>Ngắm nh&igrave;n những t&aacute;c phẩm nghệ thuật đương đại tuyệt vời, bao gồm The Starry Night của Vincent van Gogh</p>\r\n<p>H&atilde;y xem Campbell\'s Soup lon của Warhol v&agrave; The Dance (I) của Matisse</p>\r\n<p>Chi&ecirc;m ngưỡng những kiệt t&aacute;c của Gauguin, Dali, Picasso v&agrave; Pollock</p>\r\n<p>Thưởng thức hướng dẫn &acirc;m thanh miễn ph&iacute; c&oacute; sẵn bằng tiếng Anh, tiếng Ph&aacute;p, tiếng Đức, tiếng &Yacute;, tiếng T&acirc;y Ban Nha, tiếng Bồ Đ&agrave;o Nha</p>', 67, 95, 1, 'Paris Cinemas Battery', '19.277696', '72.887009', 12, NULL, '97,98,99,100,101,102', 'https://www.youtube.com/watch?v=bhOiLfkChPo', '[{\"title\":\"Guarantee Policy\",\"content\":\"- A valid credit card will be required upon booking;\\r\\n- For credit card reservations, the same card(s) must be presented upon check in at the respective hotels;\\r\\n- Management rese