INSERT INTO `bravo_hotel_translations` (`id`, `origin_id`, `locale`, `title`, `content`, `address`, `policy`, `create_user`, `update_user`, `deleted_at`, `created_at`, `updated_at`, `surrounding`, `badge_tags`) VALUES
(1, 11, 'vi', 'The May Fair Hotel', '<p>Được xây dựng vào năm 1986, Hotel Stanford là điểm du lịch bổ sung cho Thanh Hóa và là sự lựa chọn thông minh dành cho khách du lịch. Sự sôi động của trung tâm thành phố chỉ cách 0 KM. Không kém phần đặc biệt là khách sạn có thể dễ dàng tiếp cận vô số điểm tham quan và địa danh của thành phố như Toto Music Studio, Ban du lịch Quần đảo Virgin thuộc Anh, L\'Atelier Du Chocolat. Bắt đầu và kết thúc ở San Francisco! Với tour văn hóa chuyên sâu Bắc California Hè 2019, bạn có gói tour 8 ngày đưa bạn đi qua San Francisco, Mỹ và 9 điểm đến khác tại Mỹ. Bắc California Mùa hè 2019 bao gồm chỗ ở cũng như hướng dẫn viên chuyên nghiệp, các bữa ăn, phương tiện đi lại và nhiều thứ khác.</p>\r\n<p> </p>\r\n<p>ĐIỂM NỔI BẬT</p>\r\n<p>Tham quan Bảo tàng Nghệ thuật Hiện đại ở Manhattan</p>\r\n<p>Ngắm nhìn những tác phẩm nghệ thuật đương đại tuyệt vời, bao gồm The Starry Night của Vincent van Gogh</p>\r\n<p>Hãy xem Campbell\'s Soup lon của Warhol và The Dance (I) của Matisse</p>\r\n<p>Chiêm ngưỡng những kiệt tác của Gauguin, Dali, Picasso và Pollock</p>\r\n<p>Thưởng thức hướng dẫn âm thanh miễn phí có sẵn bằng tiếng Anh, tiếng Pháp, tiếng Đức, tiếng Ý, tiếng Tây Ban Nha, tiếng Bồ Đào Nha</p>', 'Paris Cinemas Battery', '[{\"title\":\"Guarantee Policy\",\"content\":\"- A valid credit card will be required upon booking;\\r\\n- For credit card reservations, the same card(s) must be presented upon check in at the respective hotels;\\r\\n- Management reserves the right to cancel any reservations without notice if we are notified of any fraud or illegal activities associated with the full payments received.\"},{\"title\":\"Children Policy\",\"content\":\"- Child under 5-year old: free of charge.\\r\\n- Child from 5-year old to under 12-year old: surcharge $10\\/person\\/room\\/night.\\r\\n- Child from 12-year old or extra Adult: surcharge $15\\/person\\/room\\/night.\"},{\"title\":\"Cancellation\\/Amendment Policy\",\"content\":\"- If cancellation\\/amendment is made 72 hours prior to your arrival date, no fee will be charged.\\r\\n- If cancellation\\/amendment is made within 72 hours, including reservations made within 72 hours of your arrival, 1st night\\u2019s room rate and tax will be charged\\r\\n- In case of no-show, 100% room rate and tax will be charged.\\r\\n- Early Bird\\/Long Stay\\/Last Min\\/Package Rates are Non - changeable & Non - refundable\"},{\"title\":\"Late check-out policy\",\"content\":\"- Late check-out is subject to room availability\\r\\n- 12:00 to 17:00 check-out: 50% room rate surcharge\\r\\n- After 17:00 check-out: 100% room rate surcharge\"}]', 1, NULL, NULL, '2024-05-24 10:14:22', '2024-05-24 10:14:22', NULL, NULL);
