(44, 'user_content_email_registered', 'user', '<h1 style=\"text-align: center;\">Ch&uacute;c mừng!</h1>\r\n<h3>Xin ch&agrave;o [first_name] [last_name]</h3>\r\n<p>Cảm ơn bạn đ&atilde; đăng k&yacute; với Việt Nam Travel! Ch&uacute;ng t&ocirc;i hy vọng bạn tận hưởng thời gian của bạn với ch&uacute;ng t&ocirc;i.</p>\r\n<p>Th&acirc;n &aacute;i,</p>\r\n<p>Việt Nam Travel</p>', NULL, 1, NULL, NULL, NULL, '2024-04-03 07:49:58'),
