(46, 'admin_content_email_user_registered', 'user', '<h3>Xin ch&agrave;o quản trị vi&ecirc;n</h3>\r\n<p>Ch&uacute;ng t&ocirc;i c&oacute; đăng k&yacute; mới</p>\r\n<p>Họ t&ecirc;n: [first_name] [last_name]</p>\r\n<p>Email: [email]</p>\r\n<p>Th&acirc;n &aacute;i,</p>\r\n<p>Việt Nam Travel</p>', NULL, 1, NULL, NULL, NULL, '2024-04-03 07:49:58'),
(47, 'user_content_email_forget_password', 'user', '<h1>Xin ch&agrave;o!</h1>\r\n<p>Bạn nhận được email n&agrave;y v&igrave; ch&uacute;ng t&ocirc;i đ&atilde; nhận được y&ecirc;u cầu đặt lại mật khẩu cho t&agrave;i khoản của bạn.</p>\r\n<p style=\"text-align: center;\">[button_reset_password]</p>\r\n<p>Li&ecirc;n kết đặt lại mật khẩu n&agrave;y sẽ hết hạn sau 60 ph&uacute;t.</p>\r\n<p>Nếu bạn kh&ocirc;ng y&ecirc;u cầu đặt lại mật khẩu, bạn kh&ocirc;ng cần thực hiện th&ecirc;m h&agrave;nh động n&agrave;o.</p>\r\n<p>Th&acirc;n &aacute;i,</p>\r\n<p>Việt Nam Travel</p>', NULL, 1, NULL, NULL, NULL, '2024-04-03 07:49:58'),
